import React from 'react';

function AboutMe() {
    return (
        <div className="aboutMeConteiner">
            <article id="aboutMe">
                Oi,<br   />
                Meu nome é Robertson Maxwel.<br/>
                Eu sou Desenvolvedor Full Stack.<br/>
                Estou sempre em busca de novos aprendizados<br/>
                Qualquer coisa que possa me ajudar a expandir meus conhecimentos é sempre bem-vinda.

                Meu lema no trabalho (como na minha vida) é "Pegue o impossível, torne-o óbvio" - dê-me uma causa nobre e eu a farei acontecer.

                Este portfólio incrível - inspirado no meu Motto e nos jogos antigos do Gameboy, foi desenvolvido por mim do zero com base em tecnologias front-end, incluindo JavaScript, HTML5 e CSS3.
                Espero que você goste :)

                Saúde,
                Daniel
            </article>
        </div>
    );
};

export default AboutMe;
